import React from "react";
import { useState, useEffect } from "react";


function App(){

    const [Input, setInput] = useState('');
    useEffect((event)=>{
        console.log(event.target.value)
        setInput(event.target.value);
        console(Input)},[]);

    function change(event){
        console.log(event.target.value)
        setInput(event.target.value);
        console(Input)
    }
    return(
        <>
        <h1>TO-DO List</h1>
        <div>
        <input type="text" onChange={change}/>

        </div>
        </>
    )
}


export default App;
